Dear team,

Nhờ anh/chị hỗ trợ kiểm tra giúp em các TH KH đã cập nhật NID thành công trên app FEOL 2.0 nhưng hệ thống không đồng bộ thông tin vào CMS V+ nhé

Trong TH có case nào liên quan đến PID KH cần chuyển eKYC kiểm tra, vui lòng chuyển ticket đến IT Card xác nhận thông tin liên quan giúp em để có hướng xử lý tương ứng.

